    return (
        <section className='max-w-full'>
            <div className='max-w-screen-xl mx-auto'>
                <div>
                    <p className='my-7 text-2xl'>Останні відгуки</p>
                    <div className="flex justify-center items-center space-x-4">
                        <button className="w-12 h-12 rounded-full bg-gray-300 flex justify-center items-center">
                            <img src={Arrow} alt="right arrow" className="w-6 h-6 transform rotate-180" />
                        </button>
                        <button className="w-12 h-12 rounded-full bg-gray-300 flex justify-center items-center">
                            <img src={Arrow} alt="left arrow" className="w-6 h-6" />
                        </button>
                    </div>
                </div>
            </div>
        </section>
    );
};

export default Section4Lending;
